'''---------------------------------
    @ Single Solution Generator
---------------------------------'''

'''
$$
$ Compared to DPLL_Solver, temporary list for assigned variables is added
$ Further solution calculation could based on 'unprocess_solu'
$$
'''

from sympy import symbols
from typing import *
from copy import deepcopy



unprocess_solu = []
class CNF:

    def __init__(self, q):
        self.temp_literal_s = []    # 初始化记录本轮赋值的 temp_literal_s
        self.cnf = q
        self.remove_same_literal()
    
    def remove_same_literal(self):
        temp = []       # 临时存储要删除的clause, 避免边遍历边修改
        for clause in self.cnf:
            for literal in clause:
                if ~literal in clause:
                    #---
                    temp.append(clause)
                    #---
                    break
        #---
        for del_clause in temp:     # 整体移除
            self.cnf.remove(del_clause)
        #---

    def unit_spread(self, single_literal):
        temp = []       # 临时存储要删除的clause, 避免边遍历边修改
        for clause in self.cnf:
        #---    
            if single_literal in clause:
                temp.append(clause)
            while ~single_literal in clause:
                clause.remove(~single_literal)
        for del_clause in temp:
            self.cnf.remove(del_clause)
        #---

    def find_single_literal(self):
        for clause in self.cnf:
            if len(clause) == 1:
                #---
                self.temp_literal_s.append(clause[0])
                #---
                return clause[0]
        else:
            return None

    def casually_return_literal(self):
        self.temp_literal_s.append(list(self.cnf[0])[0])
        return list(self.cnf[0])[0]     # 考虑 [[p11, p12], ...] 与 [p11, ...] 两种情况

    def check(self, end_all = "off"):
        if end_all == "on":
            return False
        if self.cnf != []:        # self.cnf = [[], ...] 或 其他正常情况
            if [] in self.cnf:
                return False
            return None
        else:
            return True         # self.cnf = []


def DPLL(current_cnf: CNF):
    global unprocess_solu
    single_literal = current_cnf.find_single_literal()
    while single_literal != None:
        #print(f"unit_spread with {single_literal}")
        current_cnf.unit_spread(single_literal)
        single_literal = current_cnf.find_single_literal()
    check_result = current_cnf.check()
    if check_result == True:
        #print(f"{current_cnf.temp_literal_s} is added")
        unprocess_solu += current_cnf.temp_literal_s
        return True
    elif check_result == False:
        return False
    else:
        single_literal = current_cnf.casually_return_literal()
        #print(f"casually found {single_literal}")
        new_cnf1 = CNF(deepcopy(current_cnf.cnf))
        #print("let it be true")
        new_cnf1.unit_spread(single_literal)
        if DPLL(new_cnf1) == True:
            #print(f"{single_literal} is added", new_cnf1.temp_literal_s)
            unprocess_solu += new_cnf1.temp_literal_s
            return True
        else:
            new_cnf2 = CNF(deepcopy(current_cnf.cnf))
            #print("let it be false")
            new_cnf2.unit_spread(~single_literal)
            if DPLL(new_cnf2) == True:
                #print(f"{~single_literal} is added", new_cnf1.temp_literal_s)
                unprocess_solu += new_cnf2.temp_literal_s
                return True
            else:
                return False


